import React, { Component } from 'react';
import {
  Header,
  Image,
  Grid
}
  from 'semantic-ui-react';
import Swiper from '../Swiper';
import ringImage from '../../public/images/ring-image.jpg';

import './index.css';


class Body extends Component {
  renderNotLogged = () => {
    return (
      <Header as='h1' textAlign='center'>
        Hi
      </Header>
    );
  }
  renderLogged = () => {
    return (
      <Header as='h1' textAlign='center'>
        Heyyyyy
      </Header>
    );
  }
  render() {

    const isLogged = this.props.isLogged;

    return (
      <div>
        {isLogged ?
          <div>
            {this.renderLogged()}
          </div>
          :
          <div>
            {this.renderNotLogged()}
          </div>
        }
        <Swiper />
        <Grid> 
          <Grid.Column>
          </Grid.Column>
          <Grid.Column mobile={1} tablet={2} computer={2} className="grid-col-image">
            <Image src={ringImage} className="grid-col-image"/>
          </Grid.Column>
          <Grid.Column mobile={1} tablet={2} computer={2} className="grid-col-image">
            <Image src={ringImage} className="grid-col-image"/>
          </Grid.Column>
        </Grid>
      </div >
    )
  }
}
export default Body;
